import React from 'react';

const Signup = () =>{
    return(
        <>
       <section className="signup">
           <div className="container mt-5">
                <div className="signup-content">
                    <div className="signup-form">
                        <div className="form-title">Sign up</div>
                    </div>
                </div>
           </div>
       </section>
        </>
    )
}

export default Signup;
